components:
- type: Label
  properties: {role: null, align: left, tooltip: '', border: '', foreground: '', visible: true,
    text: 'Agglomerative Clustering (AC) relies on the idea that knowing which stocks
      “move together” allows you to find the trendsetters in the market, the drivers
      of successful business. Agglomerative clustering in portfolio optimization works
      by iteratively finding the most similar pair of stocks and linking them into
      a cluster. That cluster’s center is then considered as an individual stock,
      which can be linked to another single stock or cluster. Eventually, everything
      has been “agglomerated” into a single cluster, at which point the history of
      pairing is reviewed. The point in its history at which the greatest average
      distance was observed between all clusters and their next link will be nominated
      as the ideal “cutting point” for the clusters, and the clusters at that point
      will be designated as the ideal classification for all stocks. Then, the closest
      stocks to the centers of the large clusters (clusters with at least 5% of the
      stocks in the index) will be chosen as the trendsetters, meaning that allocating
      money to them represents an aggressive investment strategy, since the data suggests
      that they all make and lose money in response to the same market shifts.', font_size: null,
    font: '', spacing_above: small, icon_align: left, spacing_below: large, italic: false,
    background: '', bold: false, underline: false, icon: ''}
  name: label_1
